 @florntlaze810  I have a timer synced to the start of the stream that I use to keep track of timestamps live as they happen. I then just write down a brief description of key/interesting moments along with the time they happened in a separate document.

 For gaming streams I usually research walkthroughs to help with formatting and titles.
If you have any other questions I'd be happy to answer, have a great day!
